INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 7001, 106001, "2030/12/17 14:59:59", "キャル", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 7, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 7002, 105901, "2030/12/17 14:59:59", "コッコロ", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 7, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 7003, 105801, "2030/12/17 14:59:59", "ペコリーヌ", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 7, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 10001, 105801, "2030/12/17 14:59:59", "ペコリーヌ", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 10, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 10002, 106001, "2030/12/17 14:59:59", "キャル", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 10, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 10003, 105901, "2030/12/17 14:59:59", "コッコロ", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 10, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (2104010, 1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 10004, 106401, "2030/12/17 14:59:59", "シェフィ", -363.0, 0, 2, "2015/12/17 15:00:00", 0.0, 0.0, 10, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 12001, 105801, "2030/12/17 14:59:59", "ペコリーヌ", -416.5, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 12, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 13001, 106001, "2030/12/17 14:59:59", "キャル", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 13, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 13002, 105901, "2030/12/17 14:59:59", "コッコロ", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 13, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (2104010, 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13003, 106401, "2030/12/17 14:59:59", "シェフィ", -363.0, 0, 2, "2015/12/17 15:00:00", 0.0, 0.0, 13, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 13004, 105801, "2030/12/17 14:59:59", "ペコリーヌ", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 13, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 14001, 105901, "2030/12/17 14:59:59", "コッコロ", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 14, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (2104010, 1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 14002, 106401, "2030/12/17 14:59:59", "シェフィ", -363.0, 0, 2, "2015/12/17 15:00:00", 0.0, 0.0, 14, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 14003, 105801, "2030/12/17 14:59:59", "ペコリーヌ", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 14, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 14004, 106001, "2030/12/17 14:59:59", "キャル", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 14, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 15001, 105901, "2030/12/17 14:59:59", "コッコロ", -470.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 15, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (2104010, 1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 16001, 106401, "2030/12/17 14:59:59", "シェフィ", -363.0, 0, 2, "2015/12/17 15:00:00", 0.0, 0.0, 16, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 16002, 105801, "2030/12/17 14:59:59", "ペコリーヌ", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 16, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 16003, 106001, "2030/12/17 14:59:59", "キャル", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 16, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 16004, 105901, "2030/12/17 14:59:59", "コッコロ", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 16, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 17002, 105901, "2030/12/17 14:59:59", "コッコロ", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 17, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 17004, 106001, "2030/12/17 14:59:59", "キャル", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 25, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 17005, 105901, "2030/12/17 14:59:59", "コッコロ", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 25, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (2104010, 1, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 17006, 106401, "2030/12/17 14:59:59", "シェフィ", -363.0, 0, 2, "2015/12/17 15:00:00", 0.0, 0.0, 25, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 17007, 105801, "2030/12/17 14:59:59", "ペコリーヌ", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 25, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 18001, 190801, "2030/12/17 14:59:59", "カリン", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 18, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 18002, 190801, "2030/12/17 14:59:59", "カリン", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 18, 2);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 19001, 190801, "2030/12/17 14:59:59", "カリン", -470.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 19, 3);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 19002, 190801, "2030/12/17 14:59:59", "カリン", -470.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 19, 4);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 20001, 190801, "2030/12/17 14:59:59", "カリン", -470.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 20, 5);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 20002, 190801, "2030/12/17 14:59:59", "カリン", -470.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 20, 6);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 21001, 106001, "2030/12/17 14:59:59", "キャル", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 21, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 21002, 105901, "2030/12/17 14:59:59", "コッコロ", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 21, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (2104010, 1, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 21003, 106401, "2030/12/17 14:59:59", "シェフィ", -363.0, 0, 2, "2015/12/17 15:00:00", 0.0, 0.0, 21, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 21004, 105801, "2030/12/17 14:59:59", "ペコリーヌ", -363.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 21, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 22001, 190801, "2030/12/17 14:59:59", "カリン", -430.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 22, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 22002, 190801, "2030/12/17 14:59:59", "カリン", -430.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 22, 2);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 23001, 190801, "2030/12/17 14:59:59", "カリン", -430.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 23, 3);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 23002, 190801, "2030/12/17 14:59:59", "カリン", -430.0, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 23, 4);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 2, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24001, 109001, "2030/12/17 14:59:59", "エリコ（バレンタイン）", -385.0, 10011, 1, "2019/01/31 12:00:00", 8.0, 4.08, 24, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24002, 109001, "2030/12/17 14:59:59", "エリコ（バレンタイン）", -385.0, 10011, 1, "2019/01/31 12:00:00", 8.0, 5.0, 24, 2);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 2, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24003, 109001, "2030/12/17 14:59:59", "エリコ（バレンタイン）", -385.0, 10011, 1, "2019/01/31 12:00:00", 8.0, 10.11, 24, 3);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 2, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24004, 109001, "2030/12/17 14:59:59", "エリコ（バレンタイン）", -385.0, 10011, 1, "2019/01/31 12:00:00", 8.0, 4.0, 24, 4);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 2, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24005, 109001, "2030/12/17 14:59:59", "エリコ（バレンタイン）", -385.0, 10011, 1, "2019/01/31 12:00:00", 8.0, 6.0, 24, 5);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24006, 109002, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 0.0, 10011, 1, "2019/01/31 12:00:00", 0.0, 0.0, 24, 6);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24007, 109002, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 0.0, 10011, 1, "2019/01/31 12:00:00", 0.0, 0.0, 24, 7);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24008, 109002, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 0.0, 10011, 1, "2019/01/31 12:00:00", 0.0, 0.0, 24, 8);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24009, 109002, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 0.0, 10011, 1, "2019/01/31 12:00:00", 0.0, 0.0, 24, 9);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24010, 109002, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 0.0, 10011, 1, "2019/01/31 12:00:00", 0.0, 0.0, 24, 10);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 2, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24011, 109101, "2030/12/17 14:59:59", "シズル（バレンタイン）", -385.0, 10011, 1, "2019/01/31 12:00:00", 8.0, 2.12, 24, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24012, 109101, "2030/12/17 14:59:59", "シズル（バレンタイン）", -385.0, 10011, 5, "2019/01/31 12:00:00", 8.0, 4.19, 24, 2);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 4, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 24013, 109101, "2030/12/17 14:59:59", "シズル（バレンタイン）", -385.0, 10011, 2, "2019/01/31 12:00:00", 8.0, 2.3, 24, 3);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 24014, 109102, "2030/12/17 14:59:59", "シズル（バレンタイン）", 0.0, 10011, 1, "2019/01/31 12:00:00", 0.0, 0.0, 24, 4);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 2, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 24015, 109101, "2030/12/17 14:59:59", "シズル（バレンタイン）", -385.0, 10011, 5, "2019/01/31 12:00:00", 8.0, 5.23, 24, 5);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 24016, 109102, "2030/12/17 14:59:59", "シズル（バレンタイン）", 0.0, 10011, 1, "2019/01/31 12:00:00", 0.0, 0.0, 24, 6);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 2, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 24017, 109101, "2030/12/17 14:59:59", "シズル（バレンタイン）", -385.0, 10011, 1, "2019/01/31 12:00:00", 8.0, 5.01, 24, 7);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 24018, 109102, "2030/12/17 14:59:59", "シズル（バレンタイン）", 0.0, 10011, 1, "2019/01/31 12:00:00", 0.0, 0.0, 24, 8);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 24019, 109102, "2030/12/17 14:59:59", "シズル（バレンタイン）", 0.0, 10011, 1, "2019/01/31 12:00:00", 0.0, 0.0, 24, 9);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 24020, 109102, "2030/12/17 14:59:59", "シズル（バレンタイン）", 0.0, 10011, 1, "2019/01/31 12:00:00", 0.0, 0.0, 24, 10);
