INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 1, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 46001, 123001, "2030/12/17 14:59:59", "アメス", -371.5, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, 46, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 2, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 47001, 104901, "2030/12/17 14:59:59", "シズル", -416.5, 0, 2, "2015/12/17 15:00:00", 0.0, 0.0, 47, 1);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (0, 2, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 47002, 101101, "2030/12/17 14:59:59", "リノ", -416.5, 0, 1, "2015/12/17 15:00:00", 0.0, 9.32, 47, 1);
